import React from 'react';
import { Button } from '../Button/Button';
import { Link } from 'react-router-dom';

export const GetStarted = ({id}) => {
  return (
    <Link to='/home'>
      <Button id={id}>Get Started <i class="fa-solid fa-arrow-right"></i></Button>
    </Link>
  )
}
